import React from "react";
import '../Footer/Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <h7 className="footer__title">Учебный проект Яндекс.Практикум х BeatFilm.</h7>
    </footer>
  );
}
export default Footer;
